import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import Nav from "./components/Nav";

function App() {
  return (
    <Router>
      <div className="">
        <Nav />
        <div className="min-h-screen bg-gray-600 text-white flex flex-col text-center">
          {/* Hero section */}
          <h1>Une Grande Selection De Sujets D'examen Gratuit</h1>
          <p>
            20 ans d'experience dans le secteur de l'education avec une large
            selection de sujets d'examens ainsi que leurs correction
          </p>
        </div>
      </div>
    </Router>
  );
}

export default App;
